import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import All from "./All"

function App() {

return (
    <div className="App">
     <h1>SnapShot</h1>
     <Router>
      <Routes>
        <Route  path='/' element={<All/>} />

      </Routes>
     </Router>
    </div>
  );
}

export default App;
